  return (
    <div id="landing_fold_container">
      <div id="landing_fold_left">
        <h1 id="landing_title_text">
          <span Style="font-weight: 700">Uncover</span> the world
          <br></br>of <span Style="font-weight: 700">Venture Capital</span>
          <br>
          </br>
          <span Style="font-weight: 300; font-size: 100px">*while still having fun</span>
        </h1>
      </div>
      <img className="computer_screen" src={ComputerScreen}>
      </img>
    </div>
  );
}

export default Landing_Fold;
